INSERT INTO `INDICATEUR_indicateur` (`id`, `code`, `libelle`, `libelle_ang`, `responsable_collecte`, `description`, `description_ang`, `composite`, `formule`, `statut`, `calcule`, `date_created`, `date_updated`, `frequence_id`, `niveau_id`, `sousysteme_id`, `unite_id`) VALUES
(1, '01R001', 'Le bilan alimentaire annuel (en valeur absolue)', 'The annual food balance sheet(in absolute value)', 'Dr Martial TRAORE', 'Selon la FAO, le bilan alimentaire donne une idée d\'ensemble de la composition des approvisionnements d\'un pays durant une période donnée', 'According to FAO, the food balance sheet gives an overall idea of ​​the composition of a country\'s supplies over a given period.', 'NON', '', 'OUI', NULL, '2024-10-13 11:22:48.496525', '2024-10-13 11:22:48.496525', 3, 1, 12, 9),
(2, '01R002', 'le nombre de zones à risques (ZAR) par an', 'The number of zones  at risks of food (ZAR) per year', 'Dr Martial TRAORE', 'Zones succeptibles d\'être affectées par l\'insécurité alimentaire ', 'Areas likely to be affected by food insecurity', 'NON', '', 'OUI', NULL, '2024-10-13 11:26:52.481184', '2024-10-13 11:26:52.481184', 3, 1, 12, 9),
(3, '01R003', 'Taux de couverture des besoins alimentaires (en pourcentage des besoins)', 'Food needs coverage rate (needs in percentage) ', 'Dr Martial TRAORE', 'Nombre de mois  sur douze(12) de couverture des besoins alimentaires suivants les normes de consommation par pays', 'Number of months out of twelve (12) of coverage of food needs following consumption standards by country', 'NON', '', 'NON', NULL, '2024-10-13 11:29:54.522656', '2024-10-13 11:29:54.522656', 3, 1, 12, 1),
(4, '01R004', 'Adoption de l\'approche bilan alimentaire en matière d\'autosuffisance/ de sécurité alimentaire ', 'Adoption of  Food balance sheet approach in terms of  self sufficiency/food Security', 'Dr Martial TRAORE', 'Nombre de pays ayant adopté l\'approche bilan alimentaire', 'Number of countries that have adopted the food balance sheet approach', 'NON', '', 'NON', NULL, '2024-10-13 11:32:18.491615', '2024-10-13 11:32:18.491615', 3, 1, 12, 9),
(5, '01R005', 'Le taux de réduction des gaps entre les prévisions (nombre de personnes vulnérables, de leur localisation, des besoins alimentaires) et la situation réelle', 'The gap reduction rate between the forecasts ( number of vulnerable people, their localization, needs for assistance) and the real situation', 'Dr Martial', 'Taux  de réduction des gaps entre les prévisions (nombre de personnes vulnérables, de leur localisation, des besoins alimentaires) et la situation réelle', 'The gap reduction rate between the forecasts ( number of vulnerable people, their localization, needs for assistance) and the real situation', 'NON', '', 'NON', NULL, '2024-10-13 12:52:03.480216', '2024-10-13 12:52:03.480216', 3, 3, 12, 1),
(6, '01R006', 'Le nombre de crises alimentaires sérieuses ou famine', 'The number of  serious food crises or famine', 'Dr Martial', 'Il s\'agit de compter le nombre de crises alimentaires sérieuses ou de famine chaque 5 ans ', 'This involves counting the number of serious food crises or famines every 5 years.', 'NON', '', 'NON', NULL, '2024-10-13 12:57:32.763172', '2024-10-13 12:57:32.763172', 3, 3, 12, 9),
(7, '01R007', 'Niveau des pertes par type de culture et par type d\'ennemis', 'Level of losses per  type of crop and crop  pest', 'Dr Idrissa MAIGA', 'Il s\'agit du pourcentage de perte occasionné par des ravageurs / maladies sur la culture infestée', 'This is the percentage of loss caused by pests/diseases on the infested crop.', 'NON', '', 'OUI', NULL, '2024-10-13 13:00:31.037975', '2024-10-13 13:00:31.037975', 3, 3, 12, 1),
(8, '01R008', 'Pourcentage zones à risques alimentaires (ZAR) par an', ' Food Zone At Risk  Percentage(ZAR) per year', 'Dr Idrissa Maiga', 'Il s\'agit du nombre de localités concernés par les ZAR sur le nombre total de localités du pays ', 'This is the number of localities concerned by the ZARs out of the total number of localities in the country.', 'NON', '', 'NON', NULL, '2024-10-13 13:03:43.565384', '2024-10-13 13:03:43.565384', 3, 3, 12, 1),
(9, '01R009', 'Pourcentage de la population affectées dans les zones à risques alimentaires (ZAR) par an', 'Percentage of the population concerned with food Zone At Risk (ZAR) per year', 'Dr Martial TRAORE', 'Il s\'agit de la population  affectées dans les ZAR sur la population totale du  niveau de decoupage 2 ', 'This is the population affected in the ZARs out of the total population of the division level 2', 'NON', '', 'OUI', NULL, '2024-10-13 13:09:36.378786', '2024-10-13 13:09:36.378786', 3, 3, 12, 1),
(10, '01S001', 'Pourcentage des superficies  infestées par type de cultures et d\'ennemis', 'Percentage of area that are affected per type of crop and crop pests', 'Dr Idrissa MAIGA', 'Il s\'agit du pourcentage de superficies infestées par type de culture et par type d\'ennemis sur le total de superficies emblavées par type de culture', 'This is the percentage of infested areas by crop type and by type of enemies out of the total areas sown by crop type.', 'NON', '', 'OUI', NULL, '2024-10-13 13:13:25.328723', '2024-10-13 13:13:25.328723', 3, 3, 12, 1),
(11, '01S002', 'Pourcentage des superficies traitées par type de cultures et d\'ennemis', 'Percentage of area treated per type of crops and crop pests ', 'Dr Idrissa MAIGA', 'Il s\'agit du pourcentage de superficies traitées par type de culture et par type d\'ennemis sur le total de superficies infestées par type de culture et par type d\'ennemis', 'This is the percentage of areas treated by crop type and by enemy type out of the total areas infested by crop type and by enemy type.', 'NON', '', 'OUI', NULL, '2024-10-13 13:16:07.629445', '2024-10-13 13:16:07.629445', 3, 3, 12, 1),
(12, '01S003', 'Niveau des dégâts par type de culture et par type d\'ennemis', 'Level of damage per type of crop and crop pest', 'Dr Idrissa MAIGA', 'Il s\'agit d\'apprécier la sévérité de l\'attaque par ennemi de culture à l\'aide d\'une grille de notation', 'This involves assessing the severity of the attack by a crop enemy using a rating grid.', 'NON', '', 'OUI', NULL, '2024-10-13 13:21:04.914655', '2024-10-13 13:21:04.914655', 3, 3, 12, 1),
(13, '01S004', 'Pourcentage des superficies affectées par les feux de brousses', 'Percentage of areas affected by bush fires', 'Dr Issa GARBA', 'il s\'agit du rapport des superficies  affectées par les feux de brousse sur la superficie végétale totale exprimée en pourcentage', 'This is the ratio of areas affected by bushfires to the total plant area expressed as a percentage.', 'NON', '', 'OUI', NULL, '2024-10-13 13:23:45.691761', '2024-10-13 13:23:45.691761', 3, 1, 12, 1),
(14, '01S005', 'Taux de couverture des besoins céréaliers', 'Cereal needs coverage rate', 'Dr Issa Garba', 'Nombre de mois  sur douze(12) de couverture des besoins céréaliers en rapport avec les normes de consomation par pays', 'Number of months out of twelve (12) of coverage of cereal needs in relation to consumption standards by country', 'NON', '', 'NON', NULL, '2024-10-13 13:27:29.795552', '2024-10-13 13:27:29.795552', 3, 1, 12, 1),
(15, '02R001', 'Pourcentage des superficie de terres dégradées ', 'Percentage of degraded land surface areas (wind erosion,moisture, salinisation)', 'Dr Issa GARBA', 'Comparaison des superficies dégradées(érosion éolienne, hydrique, salinisation) par rapport aux superficies productives (culture, forêt, paturage,…)', 'Comparison of degraded areas (wind erosion, water erosion, salinization) with productive areas (crop, forest, pasture, etc.)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:08:23.243531', '2024-10-14 09:08:23.243531', 4, 1, 10, 1),
(16, '02R002', 'Taux de progression du nombre de barrage à but agricole (agriculture, elevage, pêche)', 'Progress rate of the agriculture dam number (agriculture , livestock, fishery )', 'MAIGARY', 'Comparaison du nombre de barrages à but agricole de l\'année en cours par rapport à une référence', 'Comparison of the number of dams for agricultural purposes in the current year with a reference', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:12:06.161089', '2024-10-14 09:12:06.161089', 3, 1, 10, 1),
(17, '02R003', 'Taux d\'occupation et d\'utilisation des terres par classe', 'Land Cover rate per class (land cover) ', 'Dr Issa GARBA', 'Part de surfaces occupées par classe de l\'année en cours par rapport à la superficie totale', 'Share of occupied areas by class of the current year compared to the total area', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:14:33.790286', '2024-10-14 09:14:33.790286', 4, 1, 10, 1),
(18, '02R004', 'Taux de progression des aménagements hydro agricoles modernes (maitrise totale de l\'eau)', 'Progress rate of modern hydro agricultural arrangement ', 'Maigary', 'Comparaison du nombre d\'aménagements modernes de l\'année en cours par rapport à une référence (2014)', 'Comparison of the number of modern developments in the current year with a reference (2014)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:17:01.045451', '2024-10-14 09:17:01.045451', 3, 1, 10, 1),
(19, '03R001', 'Niveau de changement du cumul pluviométrique saisonnier', 'Change level of the seasonal rainfall total', 'Dr LONA', 'Comparaison du cumul pluviométrique saisonnier (sur une période définie) par rapport à la normale (moyenne de la période 1961-1990)', 'Comparison of cumulative seasonal rainfall (over a defined period) with normal (average for the period 1961-1990)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:23:06.117369', '2024-10-14 09:23:06.117369', 3, 1, 10, 1),
(20, '03R002', 'Niveau de changement du cumul pluviométrique mensuel', 'Change level of the monthly rainfall total ', 'Dr LONA', 'Comparaison du cumul pluviométrique mensuel (sur une période définie)par rapport à la période de référence (1961-1990)', 'Comparison of monthly cumulative rainfall (over a defined period) compared to the reference period (1961-1990)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:25:08.912970', '2024-10-14 09:25:08.913967', 3, 1, 10, 1),
(21, '03R003', 'Niveau de changement de l\'évapotranspiration potentielle (ETP) mensuel', 'Change level of the monthly potential evapotranspiration ( ETP)', 'Dr LONA', 'Comparaison de de l\'évapotranspiration potentielle (ETP)  mensuel (sur une période définie)par rapport à la période de référence (normale 1961-1990)', 'Comparison of monthly potential evapotranspiration (PET) (over a defined period) with the reference period (1961-1990 normal)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:28:22.332362', '2024-10-14 09:28:22.332362', 3, 1, 10, 1),
(22, '03R004', 'Niveau de changement de la température maximale journalière', 'Change level of the daily maximal temperature ', 'Dr LONA', 'Comparaison des moyennes de température maximale journalière (sur une période définie) par rapport à celle de la période de référence (1961-1990)', 'Comparison of daily maximum temperature averages (over a defined period) with that of the reference period (1961-1990)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:30:51.191865', '2024-10-14 09:30:51.191865', 3, 1, 10, 10),
(23, '03R005', 'Niveau de changement de la température minimale journalière', 'change level of the daily minimal temperature ', 'Dr LONA', 'Comparaison de la température mnimale journalière (sur une période définie)par rapport à la période de référence (1961-1990)', 'Comparison of the daily minimum temperature (over a defined period) with the reference period (1961-1990)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:33:33.307878', '2024-10-14 09:33:33.307878', 3, 1, 10, 10),
(24, '03R006', 'Changement des dates moyennes de fin des saisons des pluies', 'change level of  average rainfall season cessation date ', 'Dr TINNI', 'Comparaison des dates moyennes de fin des saisons des pluies sur une période donnée par rapport à la période de référence (1961-1990)', 'Comparison of average end dates of rainy seasons over a given period with the reference period (1961-1990)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:35:47.791176', '2024-10-14 09:35:47.791176', 3, 1, 10, 11),
(25, '03R007', 'Changement de la durée des séquences sèches les plus longues en début de saison', 'Change level of duration of dry spells at the onset of the season', 'Dr TINNI', 'Comparaison de la durée des séquences sèches en debut de saison par rapport à la période de référence (moyenne calculée sur plusieurs périodes)', 'Comparison of the duration of dry spells at the start of the season compared to the reference period (average calculated over several periods)', 'NON', 'Formule', 'OUI', NULL, '2024-10-14 09:38:49.697084', '2024-10-14 09:38:49.697084', 3, 1, 10, 11),
